member.param:
An e-mail address.
            If the value starts with slash "/" the address type is set to ;
            otherwise the address type is set to .

member.returns:
Value of a property specified by the given tag;
            or  if the property Tag is not present.
            Throws the  if the value cannot be converted to requested type.

Value of a Numerical named property specified by the given LID;
            or  if the property LID is not present.
            Throws the  if the value cannot be converted to requested type.

Value of a String named property specified by the given Name;
            or  if the property Name is not present.
            Throws the  if the value cannot be converted to requested type.
